const Sidebar = ({title,blue}) =>{
  const titleList = () => title.map((ttl,i)=>{
    return <li key={i}>{ttl.userId}</li>
  });
  return(
    <aside className={blue ? "sidebar open":"sidebar"} id="sidebar">
      <ul className="taskList">
        {titleList()}
      </ul>
    </aside>
  )
}

export default Sidebar;
